import './Filter.css';
const Filter = () => {
    return(
        <div className="filter">
            <div className="container">
                <div className="filter-links">
                    <h2 className='active'>link 1</h2>    
                    <h2>link 2</h2>    
                    <h2>link 3</h2>    
                </div>
                <div className="filter-selects">Selects</div>
            </div>
        </div>
    )
}
export default Filter;
